INSERT INTO `block_custom` VALUES ('1','<div id="footer-tag">NIH...Turning Discovery Into Health<sup>&reg;</sup></div>','NIH Site Footer Text','only_html'),('3','  <head>\r\n    <link href="/sites/nci-itcr/themes/multipurpose/carousel/owl.carousel.css" rel="stylesheet">\r\n    <link href="/sites/nci-itcr/themes/multipurpose/carousel/owl.theme.css" rel="stylesheet">\r\n    <link href="/sites/nci-itcr/themes/multipurpose/carousel/owl.transitions.css" rel="stylesheet">\r\n    <style>\r\n    .fp_title {color: #07486e; font-size: 16px; font-weight: bold; padding-bottom: 10px; padding-top: 10px;}\r\n    .owl-carousel div h2, .owl-carousel div .textoverlay{position:absolute; color:#FFF; font-size:16px;  padding: 20px; display:block;}\r\n    #sliderblockleft {float: left;}\r\n    #sliderblockright {float: right;}\r\n    </style>\r\n  </head>\r\n\r\n  <body>\r\n<table>\r\n <tr valign="top">\r\n <td><div id="corner"><h2>About ITCR</h2>\r\n<p>The central mission of ITCR is to promote research-driven \r\ninformatics technology across the development lifecycle to address priority needs in cancer research. \r\n<table border="0"><tr align="right"><Td><a href="about-itcr/overview" title="Learn more about ITCR" class="fp_readmore">Learn more about ITCR</a></td></tr></table></div>\r\n  </td>\r\n  <td>\r\n    <div id="demo">\r\n        <div class="container">\r\n          <div class="row">\r\n            <div class="span12">\r\n              <div id="owl-demo" class="owl-carousel">\r\n                <!-- <div class="item"><div class="textoverlay"><h1>Text 1</h1><p>Some text bla bla bla</p></div><a href="http://google.com/" target="_blank"><img src="/carousel/ndex.jpg"></a></div> -->\r\n                <div class="item"><a href="https://www.youtube.com/watch?v=9ky5NwV45qY" title="Trinity" target="_blank"><img src="http://kryp12.com/drupal/sites/all/themes/multipurpose/carousel/trinity.jpg" alt="Trinity"></a></div>\r\n                <div class="item"><a href="https://www.youtube.com/watch?v=ikK5uDEmihU" title="3D Slicer" target="_blank"><img src="http://kryp12.com/drupal/sites/all/themes/multipurpose/carousel/3dslicer.jpg" alt="3D Slicer"></a></div>\r\n                <div class="item"><a href="https://www.youtube.com/v/bVEXOtX0gMk?version=3&vq=hd1080" title="Cancer-Related Analysis of VAriants Toolkit (CRAVAT)" target="_blank"><img src="http://kryp12.com/drupal/sites/all/themes/multipurpose/carousel/cravat.jpg" alt="Cancer-Related Analysis of VAriants Toolkit (CRAVAT)"></a></div>\r\n\r\n\r\n          </div>\r\n        </div>\r\n    </div>\r\n\r\n    \r\n\r\n    \r\n\r\n    <script src="/sites/nci-itcr/themes/multipurpose/carousel/jquery-1.9.1.min.js"></script> \r\n    <script src="/sites/nci-itcr/themes/multipurpose/carousel/owl.carousel.js"></script>\r\n\r\n\r\n\r\n\r\n    <script>\r\n    $(document).ready(function() {\r\n\r\n      var owl = $("#owl-demo");\r\n\r\n      owl.owlCarousel({\r\n        navigation : false,\r\n        singleItem : true,\r\n        autoPlay: 7000,\r\n        transitionStyle : "fade"\r\n      });\r\n\r\n\r\n\r\n      $("#transitionType").change(function(){\r\n        var newValue = $(this).val();\r\n\r\n        owl.data("owlCarousel").transitionTypes(newValue);\r\n\r\n        //After change type go to next slide\r\n        owl.trigger("owl.next");\r\n      });\r\n    });\r\n    </script>\r\n\r\n  </td>\r\n \r\n </tr>\r\n</table>\r\n\r\n\r\n  </body>\r\n','Homepage carousel block','only_html');
