just the domain name.</td> </tr>\n <tr id="token-site--current-user--metatag--pragma" class="child-of-token-site--current-user--metatag even"><td>Advanced tags: Pragma</td><td class="token-key">[site:current-user:metatag:pragma]</td><td>Used to control whether a browser caches a specific page locally. Little used today. Should be used in conjunction with the Cache-Control meta tag.</td> </tr>\n <tr id="token-site--current-user--metatag--prev" class="child-of-token-site--current-user--metatag odd"><td>Advanced tags: Previous page URL</td><td class="token-key">[site:current-user:metatag:prev]</td><td>Used for paginated content. Meet Google recommendations to <a href="https://support.google.com/webmasters/answer/1663744">indicate paginated content</a> by providing URL with rel="prev" link.</td> </tr>\n <tr id="token-site--current-user--metatag--publisher" class="child-of-token-site--current-user--metatag even"><td>Advanced tags: Publisher URL</td><td class="token-key">[site:current-user:metatag:publisher]</td><td></td> </tr>\n <tr id="token-site--current-user--metatag--referrer" class="child-of-token-site--current-user--metatag odd"><td>Advanced tags: Referrer policy</td><td class="token-key">[site:current-user:metatag:referrer]</td><td>Indicate to search engines and other page scrapers whether or not links should be followed. See <a href="http://w3c.github.io/webappsec/specs/referrer-policy/">the W3C specifications</a> for further details.</td> </tr>\n <tr id="token-site--current-user--metatag--refresh" class="child-of-token-site--current-user--metatag even"><td>Advanced tags: Refresh</td><td class="token-key">[site:current-user:metatag:refresh]</td><td>The number of seconds to wait before refreshing the page. May also force redirect to another page using the format "5; url=http://example.com/", which would be triggered after five seconds.</td> </tr>\n <tr id="token-site--current-user--metatag--revisit-after" class="child-of-token-site--current-user--metatag odd"><td>Advanced tags: Revisit After</td><td class="token-key">[site:current-user:metatag:revisit-after]</td><td>Tell search engines when to index the page again. Very few search engines support this tag, it is more useful to use an <a href="https://www.drupal.org/project/xmlsitemap">XML Sitemap</a> file.</td> </tr>\n <tr id="token-site--current-user--metatag--rights" class="child-of-token-site--current-user--metatag even"><td>Advanced tags: Rights</td><td class="token-key">[site:current-user:metatag:rights]</td><td>Details about intellectual property, such as copyright or trademarks; does not automatically protect the site''s content or intellectual property.</td> </tr>\n <tr id="token-site--current-user--metatag--robots" class="child-of-token-site--current-user--metatag odd"><td>Advanced tags: Robots</td><td class="token-key">[site:current-user:metatag:robots]</td><td>Provides search engines with specific directions for what to do when this page is indexed.</td> </tr>\n <tr id="token-site--current-user--metatag--shortlink" class="child-of-token-site--current-user--metatag even"><td>Advanced tags: Shortlink URL</td><td class="token-key">[site:current-user:metatag:shortlink]</td><td>A brief URL, often created by a URL shortening service.</td> </tr>\n <tr id="token-site--current-user--metatag--abstract" class="child-of-token-site--current-user--metatag odd"><td>Basic tags: Abstract</td><td class="token-key">[site:current-user:metatag:abstract]</td><td>A brief and concise summary of the page''s content, preferably 150 characters or less. The abstract meta tag may be used by search engines for archiving purposes.</td> </tr>\n <tr id="token-site--current-user--metatag--description" class="child-of-token-site--current-user--metatag even"><td>Basic tags: Description</td><td class="token-key">[site:current-user:metatag:description]</td><td>A brief and concise summary of the page''s content, preferably 150 characters or less. The description meta tag may be used by search engines t