Apple touch icon: 180px x 180px</td><td class="token-key">[site:current-user:metatag:apple-touch-icon_180x180]</td><td>A PNG image that is 180px wide by 180px high. Used with iPhone 6 Plus with @3x display.</td> </tr>\n <tr id="token-site--current-user--metatag--shortcut-icon" class="child-of-token-site--current-user--metatag even"><td>Favicons & touch icons: Default shortcut icon</td><td class="token-key">[site:current-user:metatag:shortcut icon]</td><td>The traditional favicon, must be either a GIF, ICO, JPG/JPEG or PNG image.</td> </tr>\n <tr id="token-site--current-user--metatag--icon-16x16" class="child-of-token-site--current-user--metatag odd"><td>Favicons & touch icons: Icon: 16px x 16px</td><td class="token-key">[site:current-user:metatag:icon_16x16]</td><td>A PNG image that is 16px wide by 16px high.</td> </tr>\n <tr id="token-site--current-user--metatag--icon-32x32" class="child-of-token-site--current-user--metatag even"><td>Favicons & touch icons: Icon: 32px x 32px</td><td class="token-key">[site:current-user:metatag:icon_32x32]</td><td>A PNG image that is 32px wide by 32px high.</td> </tr>\n <tr id="token-site--current-user--metatag--icon-96x96" class="child-of-token-site--current-user--metatag odd"><td>Favicons & touch icons: Icon: 96px x 96px</td><td class="token-key">[site:current-user:metatag:icon_96x96]</td><td>A PNG image that is 96px wide by 96px high.</td> </tr>\n <tr id="token-site--current-user--metatag--icon-192x192" class="child-of-token-site--current-user--metatag even"><td>Favicons & touch icons: Icon: 192px x 192px</td><td class="token-key">[site:current-user:metatag:icon_192x192]</td><td>A PNG image that is 192px wide by 192px high.</td> </tr>\n <tr id="token-site--current-user--metatag--mask-icon" class="child-of-token-site--current-user--metatag odd"><td>Favicons & touch icons: Icon: SVG</td><td class="token-key">[site:current-user:metatag:mask-icon]</td><td>A grayscale scalable vector graphic (SVG) file.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--image0" class="child-of-token-site--current-user--metatag even"><td>Twitter card: 1st Gallery Image</td><td class="token-key">[site:current-user:metatag:twitter:image0]</td><td>A URL to the image representing the first photo in your gallery.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--image1" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: 2nd Gallery Image</td><td class="token-key">[site:current-user:metatag:twitter:image1]</td><td>A URL to the image representing the second photo in your gallery.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--image2" class="child-of-token-site--current-user--metatag even"><td>Twitter card: 3rd Gallery Image</td><td class="token-key">[site:current-user:metatag:twitter:image2]</td><td>A URL to the image representing the third photo in your gallery.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--image3" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: 4th Gallery Image</td><td class="token-key">[site:current-user:metatag:twitter:image3]</td><td>A URL to the image representing the fourth photo in your gallery.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--app--country" class="child-of-token-site--current-user--metatag even"><td>Twitter card: App Store Country</td><td class="token-key">[site:current-user:metatag:twitter:app:country]</td><td>If your application is not available in the US App Store, you must set this value to the two-letter country code for the App Store that contains your application.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--creator" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: Creator''s Twitter account</td><td class="token-key">[site:current-user:metatag:twitter:creator]</td><td>The @username for the content creator / author for this page, including the @ symbol.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--creator--id" class="child-of-token-site--current-user--metatag even"><td>Twitter card: Creator''s Twitter account ID</td><td class="token-key">[site:current-user:metatag:twitter:creator:id]</td><td>The numerical Twitter account ID for the content creator / author for this page.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--data1" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: Data 1</td><td class="token-key">[site:current-user:metatag:twitter:data1]</td><td>This field expects a string, and allows you to specify the types of data you want to offer (price, country, etc.).</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--data2" class="child-of-token-site--current-user--metatag even"><td>Twitter card: Data 2</td><td class="token-key">[site:current-user:metatag:twitter:data2]</td><td>This field expects a string, and allows you to specify the types of data you want to offer (price, country, etc.).</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--description" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: Description</td><td class="token-key">[site:current-user:metatag:twitter:description]</td><td>A description that concisely summarizes the content of the page, as appropriate for presentation within a Tweet. Do not re-use the title text as the description, or use this field to describe the general services provided by the website. The string will be truncated, by Twitter, at the word to 200 characters.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--app--url--googleplay" class="child-of-token-site--current-user--metatag even"><td>Twitter card: Google Play app''s custom URL scheme</td><td class="token-key">[site:current-user:metatag:twitter:app:url:googleplay]</td><td>The Google Play app''s custom URL scheme (must include "://" after the scheme name).</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--app--id--googleplay" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: Google Play app ID</td><td class="token-key">[site:current-user:metatag:twitter:app:id:googleplay]</td><td>String value, and should be the domain hierarchy representation of your app''s ID in Google Play.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--app--name--googleplay" class="child-of-token-site--current-user--metatag even"><td>Twitter card: Google Play app name</td><td class="token-key">[site:current-user:metatag:twitter:app:name:googleplay]</td><td>The name of the app in the Google Play app store.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--image" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: Image URL</td><td class="token-key">[site:current-user:metatag:twitter:image]</td><td>The URL to a unique image representing the content of the page. Do not use a generic image such as your website logo, author photo, or other image that spans multiple pages. Images larger than 120x120px will be resized and cropped square based on longest dimension. Images smaller than 60x60px will not be shown. If the ''type'' is set to <em>Photo</em> then the image must be at least 280x150px.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--image--alt" class="child-of-token-site--current-user--metatag even"><td>Twitter card: Image alternative text</td><td class="token-key">[site:current-user:metatag:twitter:image:alt]</td><td>The alternative text of the image being linked to. Limited to 420 characters.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--image--height" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: Image height</td><td class="token-key">[site:current-user:metatag:twitter:image:height]</td><td>The height of the image being linked to, in pixels.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--image--width" class="child-of-token-site--current-user--metatag even"><td>Twitter card: Image width</td><td class="token-key">[site:current-user:metatag:twitter:image:width]</td><td>The width of the image being linked to, in pixels.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--label1" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: Label 1</td><td class="token-key">[site:current-user:metatag:twitter:label1]</td><td>This field expects a string, and you can specify values for labels such as price, items in stock, sizes, etc.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--label2" class="child-of-token-site--current-user--metatag even"><td>Twitter card: Label 2</td><td class="token-key">[site:current-user:metatag:twitter:label2]</td><td>This field expects a string, and you can specify values for labels such as price, items in stock, sizes, etc.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--player--stream--content-type" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: MP4 media stream MIME type</td><td class="token-key">[site:current-user:metatag:twitter:player:stream:content_type]</td><td>The MIME type for the media contained in the stream URL, as defined by <a href="http://tools.ietf.org/rfc/rfc4337.txt">RFC 4337</a>.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--player--stream" class="child-of-token-site--current-user--metatag even"><td>Twitter card: MP4 media stream URL</td><td class="token-key">[site:current-user:metatag:twitter:player:stream]</td><td>The full URL for an MP4 video (h.264) or audio (AAC) stream, takes precidence over the other media player field.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--player" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: Media player URL</td><td class="token-key">[site:current-user:metatag:twitter:player]</td><td>The full URL for loading a media player. Required when using a <em>Media player</em> card.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--player--height" class="child-of-token-site--current-user--metatag even"><td>Twitter card: Media player height</td><td class="token-key">[site:current-user:metatag:twitter:player:height]</td><td>The height of the media player iframe, in pixels. Required when using a <em>Media player</em> card.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--player--width" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: Media player width</td><td class="token-key">[site:current-user:metatag:twitter:player:width]</td><td>The width of the media player iframe, in pixels. Required when using a <em>Media player</em> card.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--url" class="child-of-token-site--current-user--metatag even"><td>Twitter card: Page URL</td><td class="token-key">[site:current-user:metatag:twitter:url]</td><td>The permalink / canonical URL of the current page.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--site" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: Site''s Twitter account</td><td class="token-key">[site:current-user:metatag:twitter:site]</td><td>The @username for the website, which will be displayed in the Card''s footer; must include the @ symbol.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--site--id" class="child-of-token-site--current-user--metatag even"><td>Twitter card: Site''s Twitter account ID</td><td class="token-key">[site:current-user:metatag:twitter:site:id]</td><td>The numerical Twitter account ID for the website, which will be displayed in the Card''s footer.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--title" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: Title</td><td class="token-key">[site:current-user:metatag:twitter:title]</td><td>The page''s title, which should be concise; it will be truncated at 70 characters by Twitter. This field is required unless this the ''type'' field is set to "photo".</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--card" class="child-of-token-site--current-user--metatag even"><td>Twitter card: Twitter card type</td><td class="token-key">[site:current-user:metatag:twitter:card]</td><td>Notes: no other fields are required for a <em>Summary</em> card, a <em>Photo</em> card requires the ''image'' field, a <em>Media player</em> card requires the ''title'', ''description'', ''media player URL'', ''media player width'', ''media player height'' and ''image'' fields, a <em>Summary Card with Large Image</em> card requires the ''Summary'' field and the ''image'' field, a <em>Gallery Card</em> requires all the ''Gallery Image'' fields, an <em>App Card</em> requires the ''iPhone app ID'' field, the ''iPad app ID'' field and the ''Google Play app ID'' field, a <em>Product Card</em> requires the ''description'' field, the ''image'' field, the ''Label 1'' field, the ''Data 1'' field, the ''Label 2'' field and the ''Data 2'' field.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--app--url--ipad" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: iPad app''s custom URL scheme</td><td class="token-key">[site:current-user:metatag:twitter:app:url:ipad]</td><td>The iPad app''s custom URL scheme (must include "://" after the scheme name).</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--app--id--ipad" class="child-of-token-site--current-user--metatag even"><td>Twitter card: iPad app ID</td><td class="token-key">[site:current-user:metatag:twitter:app:id:ipad]</td><td>String value, should be the numeric representation of your iPad app''s ID in the App Store.</td> </tr>\n <tr id="token-site--current-user--metatag--twitter--app--name--ipad" class="child-of-token-site--current-user--metatag odd"><td>Twitter card: iPad app name</td><td class="token-key">[site:current-user:metatag:twitter:app:name:ipad]</td><td>The name of the iPad app.</