INSERT INTO `cache_variable` VALUES ('variable:en','a:91:{s:40:"email_confirm_confirmation_email_subject";a:12:{s:4:"type";s:6:"string";s:5:"title";s:42:"Email address change request email subject";s:7:"default";s:59:"Email address change request for [user:name] at [site:name]";s:11:"description";s:210:"The above text will be the subject for the email sent to a user that is attempting to update their email address. The placeholders [user:name] and [site:name] will be replaced by the username and the site name.";s:8:"localize";b:1;s:4:"name";s:40:"email_confirm_confirmation_email_subject";s:6:"module";s:13:"email_confirm";s:5:"group";s:7:"default";s:7:"element";a:1:{s:5:"#type";s:9:"textfield";}s:15:"format callback";s:22:"variable_format_string";s:5:"token";b:1;s:12:"allowed tags";a:0:{}}s:37:"email_confirm_confirmation_email_body";a:12:{s:4:"type";s:6:"string";s:5:"title";s:39:"Email address change request email body";s:7:"default";s:397:"Hello [user:name],\n\nA request to change your email address has been made at [site:name].\nYou need to verify the change by clicking on the link below or by\ncopying and pasting it in your browser:\n\n[email_confirm:email_url]\n\nThis is a one-time URL - it can be used only once. It expires after\n24 hours. If you do not click the link to confirm, your email address\nat [site:name] will not be updated.\n";s:11:"description";s:267:"The above text will be the body for the email sent to a user that is attempting to update their email address. The text here will be sent to the user''s new email address. The placeholders [user:name] and [site:name] will be replaced by the username and the site name.";s:8:"localize";b:1;s:4:"name";s:37:"email_confirm_confirmation_email_body";s:6:"module";s:13:"email_confirm";s:5:"group";s:7:"default";s:7:"element";a:1:{s:5:"#type";s:9:"textfield";}s:15:"format callback";s:22:"variable_format_string";s:5:"token";b:1;s:12:"allowed tags";a:0:{}}s:46:"email_confirm_confirmation_original_email_body";a:12:{s