INSERT INTO `field_data_body` VALUES ('node','page','0','150','124','und','0','<div id="mnhomepage">\r\n<h1>THE METASTATIC NICHE:</h1>\r\n\r\n<h2>Models, Mechanisms and Translating Targets</h2>\r\n\r\n<h3>A one-day symposium hosted by the National Cancer Institute</h3>\r\n\r\n<div class="button"><p><a href="#" title="Click to Register">Click to register</a></p></div>\r\n\r\n<p>March 31, 2017 - Bethesda, MD</p>\r\n\r\n<p>Metastasis remains the most challenging aspect of cancer biology. Metastatic outcome is dictated by both cell intrinsic and cell extrinsic signals that determine metastatic tumor cell survival and growth. A conducive microenvironment in distant tissue sites is composed of hematopoietic and stromal cells as well as extracellular matrix. This dynamic environment can support disseminated tumor cells, similar to a stem cell niche.</p>\r\n\r\n<p>This symposium brings together world-leading researchers in the field of metastasis, stem cells, tumor microenvironment and cancer progression in the vibrant setting of Bethesda, MD. Just prior to the AACR annual meeting.</p>\r\n</div>\r\n','','full_html'),('node','page','0','151','125','und','0','<h1>Symposium Registration</h1>\r\n\r\n<h2>Registration Fees</h2>\r\n\r\n<p>Due to limited spaces available, early registration is recommended. Fees include lunch, refreshments, closing reception, and symposium documentation.</p>\r\n\r\n<table class="table table-bordered">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th>Early Bird registration</th>\r\n			<th>Standard registration</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>Available until 15th December 2016</td>\r\n			<td>Available from 16th December 2016</td>\r\n		</tr>\r\n		<tr>\r\n			<td>All participants</td>\r\n			<td>€80</td>\r\n			<td>€95</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<div>\r\n<h2><a href="/registration-form"><strong>Register Now</strong></a><br />\r\n&nbsp;</h2>\r\n</div>\r\n\r\n<h2>Posters</h2>\r\n\r\n<p>A limited number of posters will be accepted. An abstract should be submitted at the time of registration and before 16th December.</p>\r\n\r\n<h2>Cancellation Policy</h2>\r\n\r\n<ul>\r\n	<li>Registration may be transferred to an alternative delegate at no extra charge.</li>\r\n	<li>Cancellation of registration more than four weeks prior to the event will be refunded in full.</li>\r\n	<li>Cancellation within four weeks of the event cannot be refunded.</li>\r\n</ul>\r\n\r\n<h2>Payment</h2>\r\n\r\n<p>Should you have any problems with the registration please contact us by <a href="mailto:emanuela.fioravanti@bio-techne.com?subject=Amsterdam%20Symposium">email.</a></p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<p>&nbsp;</p>\r\n','','full_html');
INSERT INTO `field_data_body` VALUES ('node','page','0','152','126','und','0','<h1>Preliminary Program</h1>\r\n\r\n<table class="table table-bordered" style="border:1px solid #ddd">\r\n	<tbody>\r\n		<tr>\r\n			<td style="background-color:#eeeeee">08:30</td>\r\n			<td style="background-color:#eeeeee">Registration</td>\r\n			<td style="background-color:#eeeeee">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>09:15</td>\r\n			<td><a href="https://www.bio-techne.com/leadership">Fernando Bazan</a>,<br />\r\n			Minneapolis</td>\r\n			<td>Welcome by Bio-Techne CTO</td>\r\n		</tr>\r\n		<tr>\r\n			<td>09:30</td>\r\n			<td><a href="http://www.gurdon.cam.ac.uk/research/surani" target="_blank">Azim Surani</a>,<br />\r\n			Cambridge</td>\r\n			<td>Origin and epigenetic programming of human primordial germ cells</td>\r\n		</tr>\r\n		<tr>\r\n			<td>10:10</td>\r\n			<td><a href="http://www.imperial.ac.uk/people/amanda.fisher" target="_blank">Amanda Fisher</a>,<br />\r\n			London</td>\r\n			<td>TBC</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="background-color:#eeeeee">10:50</td>\r\n			<td style="background-color:#eeeeee">Coffee and posters</td>\r\n			<td style="background-color:#eeeeee">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>11:20</td>\r\n			<td><a href="http://www.babraham.ac.uk/our-research/epigenetics/wolf-reik" target="_blank">Wolf Reik</a>,<br />\r\n			Cambridge</td>\r\n			<td>Epigenetic reprogramming in mammalian development</td>\r\n		</tr>\r\n		<tr>\r\n			<td>12:00</td>\r\n			<td><a href="http://www.crg.eu/en/luciano_di_croce" target="_blank">Luciano Di Croce</a>,<br />\r\n			Barcelona</td>\r\n			<td>Functional diversity of Polycomb complexes in stem cells</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="background-color:#eeeeee">12:40</td>\r\n			<td colspan="2" style="background-color:#eeeeee">Poster session and lunch provided</td>\r\n		</tr>\r\n		<tr>\r\n			<td>13:40</td>\r\n			<td><a href="https://www.helmholtz-muenchen.de/ies/index.html" target="_blank">Maria-Elena Torres-Padilla</a>,<br />\r\n			Munich</td>\r\n			<td>Epigenetic mechanisms in early mammalian development</td>\r\n		</tr>\r\n		<tr>\r\n			<td>14:20</td>\r\n			<td><a href="http://www.hubrecht.eu/onderzoekers/de-laat-group/" target="_blank">Wouter de Laat</a>,<br />\r\n			Utrecht</td>\r\n			<td>Gene regulation via cooperative versus competitive chromatin loops</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="background-color:#eeeeee">15:00</td>\r\n			<td style="background-color:#eeeeee">Coffee and posters</td>\r\n			<td style="background-color:#eeeeee">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>15:30</td>\r\n			<td><a href="http://www.hubrecht.eu/onderzoekers/creyghton-group/" target="_blank">Menno Creyghton</a>,<br />\r\n			Utrecht</td>\r\n			<td>Epigenomic annotation of regulatory changes during evolution of the brain in adult tissue and stem cell based models</td>\r\n		</tr>\r\n		<tr>\r\n			<td>16:10</td>\r\n			<td><a href="http://research.nki.nl/lohuizenlab/" target="_blank">Maarten van Lohuizen</a>,<br />\r\n			Amsterdam</td>\r\n			<td>Polycomb repressors in cell fate control and cancer: consequences for epigenetic therapy</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="background-color:#eeeeee">17:00</td>\r\n			<td colspan="2" style="background-color:#eeeeee">Closing reception and poster prize presentation</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<div>&nbsp;</div>\r\n','','full_html');
INSERT INTO `field_data_body` VALUES ('node','page','0','153','127','und','0','<div>\r\n<h1>Location and Venue</h1>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div><img alt="Beurs Van Berlage banner" height="141" src="http://symposium.bio-techne.com/img/location-banner.jpg" width="850" /></div>\r\n</div>\r\n\r\n<div>\r\n<div>\r\n<h2>Beurs van Berlage</h2>\r\nGraanbeurszaal,<br />\r\nDamrak 243,<br />\r\n1012 ZJ Amsterdam\r\n<p><a href="http://www.beursvanberlage.com/" target="_blank">www.beursvanberlage.com</a></p>\r\n\r\n<h2>To Amsterdam</h2>\r\n\r\n<p>For overseas visitors travel is advised via Amsterdam Schiphol airport.</p>\r\n\r\n<h2>Directions to the venue</h2>\r\n\r\n<ul>\r\n	<li>From Schiphol airport arrival is recommended by train, 4 trains per hour (15 minutes ride).</li>\r\n	<li>Beurs van Berlage is then just 300 metres (5 min walk) from Amsterdam Central Station.</li>\r\n	<li>Alternatively arrive from the airport via Taxi (25 minutes ride approx).</li>\r\n</ul>\r\n\r\n<h2>Accommodation</h2>\r\n\r\n<p>Beurs van Berlage Hotelservice runs a Hotelservice which can arrange hotel rooms at special room rates at four different hotels, all conveniently located within close walking distance of the venue. To make a single or block reservations with guaranteed availability and rates please click <a href="https://www.bvbroomkit.nl/epigenetic-regulation-of-stem-cell-differentiation" target="_blank">here</a>.</p>\r\n<a href="http://symposium.bio-techne.com/location#" title="Beurs Van Belage"><img alt="" src="http://symposium.bio-techne.com/img/beurs-van-belage2.jpg" /></a>\r\n\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n','','full_html'),('node','page','0','154','128','und','0','<h1>Speakers</h1>\r\n\r\n<ul>\r\n	<li><em>Chaired by</em> <strong><a href="http://www.gurdon.cam.ac.uk/research/surani" target="_blank">Azim Surani</a></strong>, <em>Cambridge</em></li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Amanda Fisher, <em>London</em></li>\r\n	<li>Wolf Reik, <em>Cambridge</em></li>\r\n	<li>Luciano Di Croce, <em>Barcelona</em></li>\r\n	<li>Maria-Elena Torres-Padilla, <em>Munich</em></li>\r\n	<li>Wouter de Laat, <em>Utrecht</em></li>\r\n	<li>Menno Creyghton, <em>Utrecht</em></li>\r\n	<li>Maarten van Lohuizen, Lohuizen, <em>Amsterdam</em></li>\r\n</ul>\r\n','','full_html');
